import React from "react";

const PrivacyPolicy = () => {
    return (
      <>
        <h1>Privacy Policy</h1>
        <p>
          This webpage is hosted on Github's Pages. 
          While I do not collect data from these pages, Github may collect your data. 
          I reserve the rights to not be liable on any data collected by Github.
        </p>
      </>
    );
  }

export default PrivacyPolicy;
